import React from 'react' ;

function Details ({historyData}){


    function getImages(){
        let images = historyData.imgs;
        let imgTags = images.map((img,ind)=>{
            return (
                <div key={ind} className="col-lg-4 col-md-6 mt4">
                    <img src={img} alt={`image number ${ind}`}/>
                </div>
            )
        })
        return imgTags;

    }
    let imgTags = getImages();
    return (

        <>
        <div className="row d-flix justify-content-center ma5">
            {imgTags}
        </div>
        <div>
            {/* {rows} */}
        </div>

        </>
    )
}
export default Details ;
